import React from 'react';
import { Card } from 'react-bootstrap';
import '../courses/courses.styles.css';

import java from '../courses/asset/java_1.png';
import selenium from '../courses/asset/selenium.png'

class Course extends React.Component{
    constructor(){
        super()
        this.state = {
            images:[java,selenium,]
        }
    }

    render(){
        return(
            <div className="container">
                <h1>Course</h1>
                <Card style={{ width: '18rem' }}>
                    <Card.Img variant="top" src={javaimg}/>
                    <Card.Body>
                        <span className="title">Java</span>
                    </Card.Body>
                </Card>
            </div>
        )
    }
}
export default Course;
